export interface SearchResults {
    stations: Station[];
    cities: City[];
    contributors: Contributor[];
    publications: Publication[];
}
export interface City {
    id: string;
    state: string;
    country: string;
    url: string;
    coordinates: Coordinates;
    name: string;
    aqi: number;
    followersCount: number;
    zoomLevel: number;
}
export interface Coordinates {
    latitude: number;
    longitude: number;
}
export interface Contributor {
    name: string;
    picture: string;
    url: string;
    followers: number;
}
export interface Publication {
    slug: string;
    thumbnailUrl: string;
    title: string;
    category: string;
}
export interface Station {
    id: string;
    name: string;
    url: string;
    coordinates: Coordinates;
    aqi: number;
    followersCount: number;
}
